INSERT INTO `wp_wc_admin_notes` VALUES (3,'wc-admin-add-first-product','info','en_US','Add your first product','Grow your revenue by adding products to your store. Add products manually, import from a sheet, or migrate from another platform.','product','{}','unactioned','woocommerce-admin','2020-04-12 20:17:20',NULL,0,'',NULL,0),(4,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2020-04-12 20:17:20',NULL,0,'',NULL,0),(5,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(6,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://localhost:8080/bh-wc-set-gateway-by-url/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(7,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','We\'re here for you - get tips, product updates and inspiration straight to your email box','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(8,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(9,'wc-admin-store-notice-giving-feedback-2','info','en_US','Give feedback','Now that youve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(10,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(12,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(13,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','info','{}','pending','woocommerce.com','2021-07-03 06:13:06',NULL,0,'plain','',0),(14,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store ready to sell as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','info','{}','pending','woocommerce.com','2021-07-03 06:13:06',NULL,0,'plain','',0),(15,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while theyre shopping on your online store. No more follow-up email requestscustomers get what they want, before theyre done checking out. Learn more about this extension that comes included in your plan.','info','{}','pending','woocommerce.com','2021-07-03 06:13:06',NULL,0,'plain','',0),(16,'wc-admin-edit-products-on-the-move','info','en_US','Edit products on the move','Edit and create new products from your mobile devices with the Woo app','info','{}','unactioned','woocommerce-admin','2021-07-03 06:13:11',NULL,0,'plain','',0),(17,'wc-admin-performance-on-mobile','info','en_US','Track your store performance on mobile','Monitor your sales and high performing products with the Woo app.','info','{}','unactioned','woocommerce-admin','2021-07-03 06:13:11',NULL,0,'plain','',0),(18,'wc-admin-manage-orders-on-the-go','info','en_US','Manage your orders on the go','Look for orders, customer info, and process refunds in one click with the Woo app.','info','{}','unactioned','woocommerce-admin','2021-07-03 06:13:11',NULL,0,'plain','',0),(19,'wc-admin-choosing-a-theme','marketing','en_US','Choosing a theme?','Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.','info','{}','unactioned','woocommerce-admin','2021-07-03 06:13:11',NULL,0,'plain','',0),(20,'wc-admin-insight-first-product-and-payment','survey','en_US','Insight','More than 80% of new merchants add the first product and have at least one payment method set up during the first week.<br><br>Do you find this type of insight useful?','info','{}','unactioned','woocommerce-admin','2021-07-03 06:13:11',NULL,0,'plain','',0),(21,'eu_vat_changes_2021','marketing','en_US','Get your business ready for the new EU tax regulations','On July 1, 2021, new taxation rules will come into play when the <a href=\"https://ec.europa.eu/taxation_customs/business/vat/modernising-vat-cross-border-ecommerce_en\">European Union (EU) Value-Added Tax (VAT) eCommerce package</a> takes effect.<br /><br />The new regulations will impact virtually every B2C business involved in cross-border eCommerce trade with the EU.<br /><br />We therefore recommend <a href=\"https://woocommerce.com/posts/new-eu-vat-regulations\">familiarizing yourself with the new updates</a>, and consult with a tax professional to ensure your business is following regulations and best practice.','info','{}','unactioned','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(22,'paypal_ppcp_gtm_2021','marketing','en_US','Offer more options with the new PayPal','Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(23,'facebook_pixel_api_2021','marketing','en_US','Improve the performance of your Facebook ads','Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(24,'facebook_ec_2021','marketing','en_US','Sync your product catalog with Facebook to help boost sales','A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(25,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(26,'your-first-product','info','en_US','Your first product','That\'s huge! You\'re well on your way to building a successful online store  now its time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(27,'wc-square-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay with Square you can increase conversion rates by letting your customers know that Apple Pay is available. Heres a marketing guide to help you get started.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(28,'wc-square-apple-pay-grow-your-business','marketing','en_US','Grow your business with Square and Apple Pay ','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(29,'wcpay-apple-pay-is-now-available','marketing','en_US','Apple Pay is now available with WooCommerce Payments!','Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>. Its free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(30,'wcpay-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay is available. Heres a marketing guide to help you get started.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(31,'wcpay-apple-pay-grow-your-business','marketing','en_US','Grow your business with WooCommerce Payments and Apple Pay','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(32,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(33,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(34,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(35,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(36,'wcpay_instant_deposits_gtm_2021','marketing','en_US','Get paid within minutes  Instant Deposits for WooCommerce Payments','Stay flexible with immediate access to your funds when you need them  including nights, weekends, and holidays. With <a href=\"https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits\">WooCommerce Payments\'</a> new Instant Deposits feature, youre able to transfer your earnings to a debit card within minutes.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(37,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(38,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your site\'s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(39,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(40,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(41,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(42,'wcpay-promo-2021-6-incentive-1','marketing','en_US','Special offer: Save 50% on transaction fees for up to $125,000 in payments','Save big when you add <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp222\">WooCommerce Payments</a> to your store today.\n                Get a discounted rate of 1.5% + $0.15 on all transactions  thats 50% off the standard fee on up to $125,000 in processed payments (or six months, whichever comes first). Act now  this offer is available for a limited time only.\n                <br /><br />By clicking \"Get WooCommerce Payments,\" you agree to the promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-half-off-six-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp222\">Terms of Service</a>.','info','{}','pending','woocommerce.com','2021-07-03 06:13:11',NULL,0,'plain','',0),(43,'wcpay-promo-2021-6-incentive-2','marketing','en_US','Special offer: No transaction fees* for up to three months','Save big when you add <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp233\">WooCommerce Payments</a> to your store today. Pay zero transaction fees* on up to $25,000 in processed payments (or three months, whichever comes first). Act now  this offer is available for 